import React from "react";
import {Link} from "react-router-dom";

import BasicItemsPage from "../subcomponents/DisplayItems";
import mealImage from "../../images/burger_fries.png";
import sideItemImage from "../../images/side_item.png";
import drinkImage from "../../images/drink.png";
import dessertImage from "../../images/dessert.png";

import shoppingCart from "../../images/checkout.png";

const OrderPage = () => {
  return(
    <div>
      <BasicItemsPage displayInfo={displayInfo} menuItemButton={menuItemButton}/>
    </div>
  );
}

const menuItemButton = () => {
  return(
    <div className="menu_button_wrapper">
      <Link to="/menu_item">
        <button className="menu-items-button ui button">
          <img className="menu-add-cart" src={shoppingCart} alt="shopping cart"></img>
          <p>Add To Order</p>
        </button>
      </Link>
    </div>
   );
}

const displayInfo = [
  {
    title: "Meals",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Sides",
    image: sideItemImage,
    url: "/sides"
  },
  {
    title: "Drinks",
    image: drinkImage,
    url: "/drinks"
  },
  {
    title: "Desserts",
    image: dessertImage,
    url: "/desserts"
  }
];

export default OrderPage;
